import { Component, OnInit } from '@angular/core';
import { ApiAuthService } from '../services/apiauth.service';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['../../styles.css'],
})
export class LoginComponent implements OnInit {

  constructor(public apiauth: ApiAuthService) {

  }

  ngOnInit() {

  }

  login(logInForm: any) {
    this.apiauth.login(logInForm.email, logInForm.password).subscribe(res => {
      console.log(res);
    })
  }
}
<form (ngSubmit)="login(logInForm.value)" #logInForm="ngForm">
  <h2>Add Elements to Users Table</h2>
  <br />
  <div class="form-group">
    <label for="email">Email:</label>
    <input type="email" class="form-control" name="email" ngModel="email">
    <label for="password">Password:</label>
    <input type="password" class="form-control" name="password" ngModel>
  </div>
  <br />

  <button type="submit" class="btn btn-primary">Log in</button>
</form>
